import './App.css';
import React from 'react';
import ApplicationBar from "./menu/ApplicationBar";
import myPhoto from "../images/myPhotoBlackWhite.png"

function App() {
    return (
        <div style={{background: '#263238', borderRadius:'0rem 0rem 5rem 5rem'}}>
            <ApplicationBar/>
            <img style={{display:'block',
                margin:'auto',opacity: '0.8'}} src={myPhoto}/>
        </div>
    );
}

export default App;


